private:
    vector<string> transform(int n, const vector<int>& freq) {
        vector<string> res;
        for (int i = 0; i < n; ++i) {
            string s;
            for (int j = 0; j < 26; ++j) {
                if (freq[j]) {
                    s += char('a' + j);
                    --freq[j];
                }
            }
            res.push_back(s);
        }
        return res;
    }
};

