public class ReorderLogFiles {
    public String[] reorderLogFiles(String[] logs) {
        List<String> letters = new ArrayList<>();
        List<String> digits = new ArrayList<>();
        for (int i = 0; i < logs.length; i++) {
            if (logs[i].split(" ")[1].charAt(0) >= '0' && logs[i].split(" ")[1].charAt(0) <= '9') {
                digits.add(logs[i]);
            } else {
                letters.add(logs[i]);
            }
        }
        Collections.sort(letters, (o1, o2) -> {
            int index1 = o1.indexOf(' ') + 1;
            int index2 = o2.indexOf(' ') + 1;
            return o1.substring(index1).compareTo(o2.substring(index2));
        });
        Collections.sort(digits);
        return Stream.concat(letters.stream(), digits.stream()).toArray(String[]::new);
    }
}

