    vector<vector<char>> replaceWords(vector<string>& dict, string sentence) {
        unordered_map<string, int> mp;
        for (int i = 0; i < dict.size(); ++i) {
            mp[dict[i]] = i + 1;
        }
        vector<vector<char>> ans;
        stringstream ss(sentence);
        string word;
        while (ss >> word) {
            if (mp.count(word)) {
                ans.push_back({word[0], word[1], word[2]});
            } else {
                auto it = mp.lower_bound(word);
                if (it!= mp.end()) {
                    ans.push_back({word[0], word[1], word[2]});
                } else {
                    ans.push_back({'#', '#', '#'});
                }
            }
        }
        return ans;
    }
